                        worksheet.write_column(0, 10, self.ExFeedgonioresult3)
                        worksheet.write_column(0, 11, self.ExFeedsemgdata3)
                        print("save to excel complete")
                        print(self.detect1)
                        self.show_popupSave("Data Save")
                        self.changeFileNamePage()
